import React, { Component } from 'react';
import { variables } from './Variables.js';

export class Home extends Component {
    constructor(props) {
        super(props);

        this.state = {
            PhotoPath: variables.PHOTO_URL
        }
    }

    render() {
        const {
            PhotoPath,
        } = this.state;
        return (
            <div>
                <br />
                
                <div>
                    <img width="340px" height="400px" align="left" src={PhotoPath + 'Many_formal.jfif'} />  
                </div>
                <div>
                    <br />
                    <h3 align="center" >Manuel Eduardo Rivera Argueta</h3>
                    <p align="justify">
                        <b>Acerca de: </b>Soy una persona responsable con una gran motivacion para aprender y realizar mi trabajo de manera eficaz, dispuesto a adaptarme a cualquier ambiente de trabajo y siempre dar lo mejor de mi como profesional y persona, cuento con exelentes habilidades para el trabajo en equipo.
                        Tengo 3 a√±os de experiencia en el area de IT, trabajando como analista QA y como desarrollador web y full stack, siendo muy meticuloso en los proyectos que realizo, ademas estoy acostumbrado a trabajar bajo presion y a alcanzar los objetivos propuestos de los proyectos.
                    </p>
                </div>
                
            </div>
        )
    }
}
